import React from 'react';
import { useAppSelector } from '../hook';

const LoginAuthorized = () => {
  const { username } = useAppSelector((state) => state.user);

  return (
    <>
      <div>Вы уже авторизованы под {username}</div>
    </>
  );
};

export default LoginAuthorized;
